import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Student from "./componets/Student";

function App() {
  return (
    <>
      <div className="App">
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<Student />}></Route>
          </Routes>
        </BrowserRouter>
      </div>
    </>
  );
}

export default App;
